import './App.css';
import React, {Component , Fragment } from 'react';
import { Switch, Route } from 'react-router-dom'

import Error from './Error/Error'
import Home from './Home/Home';
import WebNavBar from './WebNavBar/WebNavBar'
import SignIn from './User-UI/SignIn/SignIn';
import SignUp from './User-UI/SignUp/SignUp';
import About from './About/About';


export class App extends Component {

  state = {
    user : [{ user_name : "yahya", user_email : "gamesy865@gmail.com",user_pass : "123azeAZE"}]
  }

  render() {
    return (
      <div>
        <WebNavBar name={this.state.user[0].user_name} email={this.state.user[0].user_email} password={this.state.user[0].user_pass} />

        <Switch>
          <Route path="/" component={Home} exact />
          <Route path="/About" component={About} exact />
          <Route path="/register" component={SignUp} exact />
          <Route path="/login" component={SignIn} exact />

          <Route component={Error} exact />
        </Switch>


      </div>
    )
  }
}

export default App
